import React from 'react';
import { Box, Button, Typography } from '@mui/material';
import { useNavigate } from 'react-router-dom';


const HomePage: React.FC = () => {
    const navigate = useNavigate();

    const doStartEditingClick = () => {
        navigate('/photos');
    };

    return (
      <>
          <Box
            sx={{
              height: '120px',
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center',
              textAlign: 'center',
              background: 'linear-gradient(135deg, rgba(255, 0, 0, 0.9) 0%, rgba(200, 0, 0, 0.85) 50%, rgba(139, 0, 0, 1) 100%)',
              backdropFilter: 'blur(10px)',
            }}
          >
            <Typography variant="h6" fontSize={"24px"} color='white'>
              Welcome to depop<i>Dash</i>.
            </Typography>
          </Box>
          <Box
            sx={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center',
              height: '850px',
              border: '2px solid blue'
            }}
          >
            <Box
              sx={{
                display: 'flex',
                flexDirection: 'column',
                justifyContent: 'center',
                textAlign: 'left',
                width: '50%',
                height: '100%',
                gap: 3,
                border: '2px solid blue'
              }}
            >
              <Typography variant="h6" fontSize="40px" color="text.secondary">
                <b>Save time editing product photos.</b>
              </Typography>
              <Typography variant="h6" fontSize="17px" color="text.secondary">
                depop<i>Dash</i> is an AI-powered tool that allows sellers to automate editing product photos for marketplaces such as Depop.
              </Typography>
              <Typography variant="h6" fontSize="17px" color="text.secondary">
                Effortlessly refine your Depop listings to boost sales & engagement. Developed by a Depop Top Seller.
              </Typography>
              <Button
                variant="contained"
                sx={{
                  backgroundColor: 'primary',
                  color: 'black',
                  ':hover': {
                    backgroundColor: '#ff4040',
                  },
                  mt: 3
                }}
                onClick={doStartEditingClick}
              >
                <Typography variant="h6" fontSize="16px" color="white">
                  Try it now
                </Typography>
              </Button>
            </Box>
            <Box>
              <Typography variant="h6" fontSize="17px" color="text.secondary">
                photo goes here
              </Typography>
            </Box>
          </Box>
          <Box
            sx={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center',
              padding: 5,
            }}
          >
            <Box
              sx={{
                width: '70vw',
                display: 'flex',
                flexDirection: 'row',
                border: '2px solid orange'
              }}
            >
              <Box
                sx={{
                  width: '40%',
                  height: '300px',
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'left',
                  justifyContent: 'space-between',
                  padding: 3,
                  background: 'linear-gradient(to right, rgba(99, 99, 99, 0.9), rgba(99, 99, 99, 0.7))',
                  borderTopLeftRadius: '8px',
                  borderBottomLeftRadius: '8px',
                  backdropFilter: 'blur(5px)',
                }}
              >
                <Typography variant="h6" fontSize="22px" color="white">
                  <b>Improve your page aesthetics.</b>
                </Typography>
                <Typography variant="h6" fontSize="16px" color="white">
                  Advanced photo editing tools on depop<i>Dash</i>.
                </Typography>
                <Button
                  variant="contained"
                  sx={{
                    backgroundColor: 'white',
                    color: 'black',
                    ':hover': {
                      backgroundColor: '#f0f0f0',
                    },
                    mt: 3
                  }}
                  onClick={doStartEditingClick}
                >
                  Start Editing
                </Button>
              </Box>
              <Box
                sx={{
                  width: '60%',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'left',
                  borderRadius: '8px',
                  overflow: 'hidden',
                  mr: -3,
                  mt: -3,
                }}
              >
                <img
                  src='/images/depopPhonePic.png'
                  alt='Depop Phone Art'
                  style={{
                    width: 'auto',
                    height: 'auto',
                    borderTopRightRadius: '8px',
                    borderBottomRightRadius: '8px',
                    objectFit: 'cover',
                    maxHeight: '300px',
                  }}
                />
              </Box>
            </Box>
          </Box>
      </>
    );
}

export default HomePage;
